import Button from '../UI/Button';
import styled from './ExpensForm.module.css';

const Card = () => { 

    return (

     <form className={styled['form-control']}>
       <label>UserName</label>
       <input type="text" />
       <label>Age(years)</label>
       <input type="number" />
       <div> 
       <Button type={'submit'}>Add User</Button>
       </div>
     </form>   
    );
}
export default Card ;
